import {INCREMENT,DECREMENT} from "./actionTypes"
import axios from 'axios'

export const increment = ()=>{
  return {
    type: INCREMENT
  }

}

export const decrement = ()=> {
  return {
    type: DECREMENT
  }
}

export const signup = (userData) => {
  return {
    type: "SIGNUP",
    payload: userData
  }
}
